webpackJsonp([0xc3780ac61d30],{514:function(e,a){e.exports={data:{site:{siteMetadata:{title:"My Code bad",author:"Guillermo Paredes Torrez"}},markdownRemark:{id:"/home/gd/Development/MyCodeBad/blog/src/pages/ReactBolivia/index.md absPath of file >>> MarkdownRemark",html:'<p>En ReactBoliva, somos un grupo de apasionados del desarrollo web y del javascript que nos gusta siempre aprender mas y compartir nuestros conocimientos. React simboliza nuestra amor por javascript haciendo posible construir interfaces geniales y siendo ahora la librería mas descargada:</p>\n<p><a href="http://www.npmtrends.com/@angular/core-vs-angular-vs-react-vs-vue">http://www.npmtrends.com/@angular/core-vs-angular-vs-react-vs-vue</a></p>\n<p>Nuestra mision es difundir los conocimientos sobre react en nuestra comunidad, crear un espacio oportuno para que nuestros asistentes hagan networking, difundir oportunidades de congresos, cursos y tambien atraer la atencion de la instituciones publico y privadas para ser el puente de oportunidades laborales. Por ultimo un objetivo es hacer contacto con facebook, expertos interacionales y comunidades de otros pais, tal que podamos brindar a la comunidad de las mejores charlas y oportunidades de crecimiento.</p>\n<p>Nuestra vision es hacer de react una tegnologia que se use mas en nuestro pais promoviendo la actualizacion a nuevas tegnologias con la comunidad como un actor importante.</p>\n<p>Unete a nuestro grupo donde tocaremos temas de ReactJS y React Native, desde los fundamentos hasta las ultimas tendencias buscando siempre llegar tanto a los mas expertos como a los que están iniciando.</p>\n<p>Unete a nuestras paginas y grupos de redes sociales donde se postean:</p>\n<p>Puedes seguirnos en nuestra pagina de facebook: <a href="https://www.facebook.com/ReactBolivia/">ReactBolivia</a>.\nPuedes seguirnos en nuestra pagina de twitter: <a href="https://twitter.com/ReactBolivia/">@ReactBolivia</a>.</p>',frontmatter:{title:"React Bolivia",date:"August 24, 2018"}}},pathContext:{slug:"/ReactBolivia/",previous:{fields:{slug:"/ssh-para-git/"},frontmatter:{title:"Ssh para Github, Gitlab, Bitbucket, etc"}},next:{fields:{slug:"/react-p1/"},frontmatter:{title:"React.js + Firebase - Parte 1"}}}}}});
